import axios from 'axios';

// Point this to your Node.js server
const API = axios.create({ baseURL: 'http://localhost:5000' });

export const searchDoctors = (name) => API.get(`/api/search-doctors?name=${name}`);
export const fetchLocker = (patientName) => API.get(`/api/my-locker?patientName=${patientName}`);
